import { createSlice } from "@reduxjs/toolkit";

export const todosSlice = createSlice({
    name:'todos',
    initialState:{
        items:[
        {
            id:"1",
            title:"TEST",
        },
        {
            id:"2",
            title:"MURO",
        }
    ],
    },
    reducers:{},
})

export default todosSlice.reducer;
